    <div class="legend">
        <div class="rect dark"></div> bone preservation &gt;75% <br>
        <div class="rect grey"></div> bone preservation &lt;75% <br>
        <div class="rect pale"></div> affected <br>
        <div class="rect white"></div>  unknown / absent <br>
    </div>

<script>

  // Config
  var url_string = window.location.href
  var url = new URL(url_string);
  var bone_parameter = url.searchParams.get("bones");
  var show_all = url.searchParams.get("show_all");
  var show_help = url.searchParams.get("show_help");
  var copy_id = url.searchParams.get("copy_id");
  const paths = document.querySelectorAll("svg path");

  // Helper
  let selectColor = (colorNum, colors) => {
    if (colors < 1) colors = 1; // defaults to one color - avoid divide by zero
    return "hsl(" + (colorNum * (360 / colors) % 360) + ",100%,80%)";
  }

  // highlight all
  let higlight_all = () => {
    paths.forEach((p,i)=>{
        if (p.classList.contains("bone__section")) {
            p.style.fill = selectColor(Math.floor(Math.random() * 999), 10);
        }}
      )
  }

  let copy_id_to_clipboard = () =>{
    paths.forEach((p,i)=>{
        if (p.classList.contains("bone__section")) {
          p.addEventListener("click", event => {
            navigator.clipboard.writeText(p.id)
          });
        }}
      )
  }

  color_keys = {
    ">75%": "#484848",
    "<75%": "#A8A8A8",
    "affected": "#fd5c63",
    "unknown": "#ffffff"
  }

/*
  // highlight single
  let highlight_single_bones = bone_parameter => {
    bone_parameter = JSON.parse(bone_parameter);
    console.log(bone_parameter)

    for (let key in bone_parameter) {
      for(element of bone_parameter[key]){
      var selected_bone = document.getElementById('bone'+element);

      if (selected_bone){
          selected_bone.style.fill = color_keys[key];
      }
    }

    }
  }
*/

let highlight_single_bones = bone_parameter => {
    bone_parameter = JSON.parse(bone_parameter);
    console.log(bone_parameter);

    for (let key in bone_parameter) {
        for(element of bone_parameter[key]){
            var selected_bones = document.querySelectorAll('[id="bone' + element + '"]');

            selected_bones.forEach(selected_bone => {
                if (selected_bone){
                    selected_bone.style.fill = color_keys[key];
                }
            });
        }
    }
}


  // show  helper title
  const addStyle = (() => {
    const style = document.createElement('style');
    document.head.append(style);
    return (styleString) => style.textContent = styleString;
  })();

  // start script
  if (bone_parameter) highlight_single_bones(bone_parameter)
  if (show_all) higlight_all();
  if (copy_id) copy_id_to_clipboard();
  if (show_help) {
    addStyle(`
      svg path {
        pointer-events: all!important;
        cursor: pointer;
      }
    `);
  };

</script>
